import React from "react";
import MenuIcon from '@mui/icons-material/Menu';
import Container from "@mui/material/Container";
import './header.css'
import { NavLink } from 'react-router-dom'

const navLinks = [
  {
    display: "Home",
    url: "/home",
  },
  {
    display: "About",
    url: "/about",
  },
  {
    display: "Service",
    url: "/services",
  },
  {
    display: "Portfolio",
    url: "/portfolio",
  },
  {
    display: "Contact",
    url: "/contact",
  },
];

const Header = () => {
  return (
    <>
      <nav className="header" >
        <Container className="container-nav">
          <div className="navigation d-flex  justify-content-between ">
            <div className="logo ">
            <NavLink to='/'><img src="img/logo.png" className="logo-img" alt="logo"/></NavLink>
            </div>
            <div className="nav-menu">
              <ul className="nav-list">
                {navLinks.map((item, index) => (
                  <li className="nav-item" key={index}>
                    <NavLink to={item.url}>{item.display}</NavLink>
                  </li>

                ))}
                <li className="nav-item">
                            <NavLink className="nav-link" to="/contact">Contact</NavLink>
                  </li>
              </ul>
            </div>
            <div className="navigation ">
                <button className="btn mt-3" id="btn-nav">Let's Talk</button>
                <span className="mobile-menu"><MenuIcon/></span>
            </div>
          </div>
        </Container>
      </nav>
    </>
  );
};

export default Header;
